import React from "react";
import Model from "../models/Model.js";
export default class List extends React.Component {
    constructor(props) {
        console.log(props)
        super(props);
    }
    render() {
        return (
            <div className="List">
                 <div className="col-lg-4">
                    {this.props.list.map(model => {
                        if(model._id){
                            <div className = "Model">
                                <Model model = {model}/>
                            </div>
                        }
                        else{
                            return(
                                <div className = "Model">
                                    {model}
                                </div>
                            ) 
                        }
                    })}
                 </div>
            </div>
        )
    }
}
